import "./Home.css";
import { Link } from "react-router-dom";
import { useState } from "react";
import { useRef } from "react";
import Movies from "../components/Movies";
import Bmovies from "../components/Bmovies";
const Search = () => {
  const [disp, setdisp] = useState(null);
  const nav = useRef();
  const btn = useRef();

  function toogle() {
    if (disp == null) {
      setdisp("show");
      nav.current.style.background = "black";
    } else {
      setdisp(null);
      nav.current.style.background = "none";
    }
  }
  const keypress = (event) => {
    console.log(event);
    if (event.key === "Enter") alert("helll");
  };
  return (
    <>
      <div className="nav2" ref={nav}>
        <div className="logo">
          <Link to="/">
            <img
              src="./images/netflix-logo-png-2583.png"
              className="logo-l"
              alt=""
            />
          </Link>
        </div>
        <div className="items2">
          <Link to="/" className="home">
            Home
          </Link>
          <Link to="/movies" href="#type">
            Hollywood
          </Link>
          <Link to="/bollywood" href="#type">
            Bollywood
          </Link>
        </div>
        <div className="bar"></div>

        <button className="menu2" onClick={toogle}>
          <i className="fa fa-bars"></i>
        </button>
      </div>
      <div className={`menuitems ${disp}`}>
        <Link to="/" className="home">
          Home
        </Link>
        <Link to="/movies" href="#type">
          Hollywood
        </Link>
        <Link to="/bollywood" href="#type">
          Bollywood
        </Link>
      </div>
      <div className="search-a">
        <input
          type="text"
          className="search-input"
          placeholder="Search"
          onKeyPress={keypress}
        />
        <button className="search-button" ref={btn}>
          Search
        </button>
      </div>
    </>
  );
};

export default Search;
